import React, { useMemo, useState } from "react";
import DataTable from "react-data-table-component";
import toast from "react-hot-toast";
import {
  useGetPilotsQuery,
  useDeletePilotMutation,
} from "../../redux/api/pilotApi";
import PilotForm from "./PilotForm";

const PilotList = () => {
  const { data, isLoading, refetch } = useGetPilotsQuery();
  const [deletePilot] = useDeletePilotMutation();

  const pilots = data?.pilots || [];
  const [showForm, setShowForm] = useState(false);
  const [editingPilot, setEditingPilot] = useState(null);
  const [search, setSearch] = useState("");

  const filtered = useMemo(() => {
    if (!search.trim()) return pilots;
    const q = search.toLowerCase();
    return pilots.filter((p) =>
      `${p.name} ${p.email} ${p.mobile} ${p.licenseNumber} ${p.status}`
        .toLowerCase()
        .includes(q)
    );
  }, [pilots, search]);

  const handleDelete = async (id) => {
    if (!window.confirm("Delete this pilot?")) return;
    try {
      await deletePilot(id).unwrap();
      toast.success("Pilot deleted");
      refetch();
    } catch {
      toast.error("Delete failed");
    }
  };

  const columns = [
    {
      name: "Photo",
      cell: (row) =>
        row.photo?.url ? (
          <img
            src={row.photo.url}
            alt={row.name}
            width="40"
            height="40"
            style={{ objectFit: "cover", borderRadius: "4px" }}
          />
        ) : (
          "-"
        ),
      center: true,
      width: "90px",
    },
    { name: "Name", selector: (row) => row.name, sortable: true },
    { name: "License", selector: (row) => row.licenseNumber, sortable: true },
    {
      name: "Experience",
      selector: (row) => `${row.experienceYears || 0} yrs`,
      center: true,
    },
    {
      name: "Base",
      selector: (row) =>
        row.baseAirport
          ? `${row.baseAirport.name} (${row.baseAirport.code})`
          : "-",
      sortable: true,
    },
    {
      name: "Rating",
      selector: (row) => row.rating ?? 0,
      center: true,
      width: "110px",
    },
    {
      name: "Status",
      cell: (row) => (
        <span
          className={`badge bg-${
            row.status === "active" ? "success" : "secondary"
          }`}
        >
          {row.status}
        </span>
      ),
      center: true,
      width: "120px",
    },
    {
      name: "Actions",
      cell: (row) => (
        <div className="dropdown">
          <button
            className="btn btn-sm btn-secondary dropdown-toggle"
            type="button"
            data-bs-toggle="dropdown"
            aria-expanded="false"
          >
            Actions
          </button>
          <ul className="dropdown-menu">
            <li>
              <button
                className="dropdown-item"
                onClick={() => {
                  setEditingPilot(row);
                  setShowForm(true);
                }}
              >
                Edit
              </button>
            </li>
            <li>
              <button
                className="dropdown-item text-danger"
                onClick={() => handleDelete(row._id)}
              >
                Delete
              </button>
            </li>
          </ul>
        </div>
      ),
      ignoreRowClick: true,
      button: true,
      center: true,
      width: "140px",
    },
  ];

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h4>Pilots</h4>
        <button
          className="btn btn-primary"
          onClick={() => {
            setEditingPilot(null);
            setShowForm((s) => !s);
          }}
        >
          {showForm ? "Hide Form" : "Add Pilot"}
        </button>
      </div>

      {showForm && (
        <PilotForm
          editingPilot={editingPilot}
          setShowForm={setShowForm}
          refetch={refetch}
        />
      )}

      <div className="mb-3">
        <input
          className="form-control"
          placeholder="Search pilot by name, email, license, statusâ€¦"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />
      </div>

      <DataTable
        columns={columns}
        data={filtered}
        progressPending={isLoading}
        pagination
        highlightOnHover
        responsive
        striped
        persistTableHead
      />
    </div>
  );
};

export default PilotList;
